description:
Trial/Public Beta for WMMA3.

The World of Mixed Martial Arts 2 (WMMA2) is a PC game designed by Adam Ryland and Grey Dog Software, the makers of the Total Extreme Warfare series. It includes fictional fighters with descriptive bios to make the game interesting. It is a simulation game, in which the player is the booker of a Mixed Martial Arts promotion. Players may create their own promotion from scratch or start with one already in game.

If the fake universe isnt your thing then try a real world mod.
